import React from 'react';
import SocialItem from './SocialItem';


function Social(){

  return(





      <ul className='list-group'>

      <SocialItem 
      media='Facebook' 
      id= 'facebook'
      img='https://picsum.photos/200'
      />

      <SocialItem 
      media='Youtube' 
      id= 'youtube'
      img='https://picsum.photos/201'
      />

      <SocialItem 
      media='Instagram' 
      id= 'instagram'
      img='https://picsum.photos/202'
      />



    </ul>


  );
}
export default Social;
